echo "Configure database user"
read -p "Postgres user name: " name
read -s -p "Postgres user password: " password

export POSTGRES_USER=$name
export POSTGRES_PASSWORD=$password
export DB_NAME="dataservice"

sudo docker rm --force postgres || true

echo "Creating database container (and seed 'dataservice' database)"

sudo docker run -d \
  --name postgres \
  -e POSTGRES_USER=$POSTGRES_USER \
  -e POSTGRES_PASSWORD=$POSTGRES_PASSWORD \
  -e POSTGRES_DB=$DB_NAME \
  -p 80:5432 \
  --restart always \
  postgres:9.6.8-alpine


sleep 120 # Ensure enough time for postgres database to initialize and create role

sudo docker exec -i postgres psql -U $POSTGRES_USER -d $DB_NAME <<-EOF
create table employes (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	city VARCHAR(50),
	language VARCHAR(50),
	salary VARCHAR(50)
);
